import React from 'react';
import './card-list.css';

const CardList = props => {
  console.log(props);
  const { monster } = props;
  return (
    <div className="card-list">
      {monster.map(monsterName => {
        return <Card key={monster.id} />;
      })}
    </div>
  );
};
export default CardList;
